import React from 'react';
import { useLocation } from 'react-router-dom';
import './StudentProfile.css';
import image from './assets/logo.png'; // Update this path as necessary
import studentPhoto from './assets/profliephoto.jpg'; // Ensure the image file is located here

function ProfilePage() {
  const location = useLocation();
  const { student } = location.state || {}; // Get the student data from the state

  if (!student) {
    return <div>No student selected</div>;
  }

  return (
    <>
      <div className="header">
        <img src={image} alt="Logo" />
      </div>
      <div className="profile-container">
        {/* Profile content using student data */}
        <div className="profile-header">
          <div className="profile-header-content">
            <div className="profile-photo">
              <img src={studentPhoto} alt="Student" />
            </div>
            <h2>{student.name}'s Profile</h2>
          </div>
        </div>
        <div className="profile-details">
          <div className="detail-row">
            <div className="detail-label">Name:</div>
            <div className="detail-value">{student.studentname}</div>
          </div>
          <div className="detail-row">
            <div className="detail-label">Registration No:</div>
            <div className="detail-value">{student.studentid}</div>
          </div>
          {/* Add more details here as needed */}
        </div>
      </div>
    </>
  );
}

export default ProfilePage;
